//import logo from '../../img/logo-187x66.png';
import classes from './About.module.css'
import BlockHead from "../BlockHead/BlockHead";
import BannerHead from "../../img/slider_image.png";
import {NavLink} from "react-router-dom";

    let title="about sparkle appz";






const  About = () =>{
    let div = <>
        <div className={classes.block}>
            <h1>about</h1>
            <span>sparkle appz</span>
            <BlockHead text={title} img={BannerHead}>
                <p><NavLink to ='/home'>Sparkle Appz</NavLink> is an IT company in India, offering quality software
                    related solutions including <NavLink to ="">Mobile Application Development</NavLink>,
                    <NavLink> </NavLink>
                    We believe in <strong>“Complete Customer Satisfaction”</strong>
                    as our definition of quality. </p>
                <p>We focus to deliver our expertise to our
                    clients within time and make sure that our solutions be aesthetic,
                    technically functional, user-friendly and responsive.</p>
            </BlockHead>
        </div>
    </>;

};


export default About;
